import React from "react";
import { Box } from "@material-ui/core";


function Ellipse() {
    return (
        <Box sx={{
            backgroundColor: '#ed7e81',
            color: '#ffffff',
            height: '20px',
            width: '20px',
            borderRadius: '50%'
        }}>+</Box>
    )
}

export default Ellipse;
